    "idealYourWeight": "وزن المثالي لكم",
    "paymentText": "اشتراك أكسيجن فيت\nلقد أضفنا ميزات جديدة، بالإضافة إلى عدّاد السعرات الحرارية وعدّاد الخطى لتقديم التطبيق الأكثر فعالية وشخصية لتقليل وزنك وزيادته وكذلك اللياقة البدنية الخاصة بك.\nإدارة القيمة الغذائية\nتغذّى حسب ظروفك\nيمكنك تحديد هدفك اليومي لـ 34 مادة مغذية، ونحن نقوم بمراقبة وعرض الكمية التي يتم امتصاصها من كل مادة مغذية لك تلقائيا، وهذه فرصة جيدة جدا لك.\nكمية الماء يوميا\nاستهلك الماء وفقا لحاجتك\nتختلف كمية الماء التي ينبغي لكل شخص استهلاكه يوميا حسب جسم نفس الشخص. ونحن نقوم بتحديد ومراقبة كمية الماء يوميا لك نظرا للميزات التي حصلنا عليها من جسمك.\nالماء الذي تم امتصاصه من كل مادة غذائية\nإعلم كمية امتصاص الماء من كل طعام أو مادة غذائية\nربما يكون مثيرا للإهتمام معرفة كمية امتصاص الماء لجسمك بعد تناول كل مادة أو وجبة غذائية! نحن نقوم بحساب ومراقبة هذه الكمية تلقائيا ويمكنك رؤية هذه الكمية في قسم الماء. ولذلك حسبك فقط تسجيل كمية استهلاك الطعام والشراب يوميا.\nمعلومات الجسم\nمن خلال إدخال مقياس قامتك وهندامك في تطبيق أكسيجن فيت، يمكنك العثور على المعلومات الخاصة لجسمك مثل نوع الجسم، وشكل الجسم، وكتلة الجسم، والوزن المثالي وعديد من الأشياء الأخرى. كما يمكنك معرفة ما هي الأمراض التي يتعرض جسمك لها، ونحن نساعدك على تسجيل ومراقبة مقدار صحة جسمك.\nالممارسات البدنية والرياضية\nدعونا نكون أكثر نشاطا!\nالممارسات الرياضية هي أفضل طريق للحصول على اللياقة البدنية الخاصة بك وتحسين صحتك. ومن خلال وجود اشتراك أكسيجن فيت، يمكننا مساعدتك في تحقيق المزيد من الهدف والنشاط. نحن نقدم لك في أكسيجن فيت 800 أنشطة، و118 تمارين كاردیو، و1000 تمارین بدنية أو كمال الأجسام مع الفلم والمعلومات الكاملة ومع حساب السعرات الحرارية الضرورية حسب وزنك.\nمراقبة النوم\nهل كان لديك نوم مريح اليوم؟\nوجود اشتراك أكسيجن فيت يتيح لك فرصة تسجيل مقدار نومك اليومي وجودة نومك، وأيضا العثور على المعلومات الجذابة لنومك أسبوعيا وشهريا.\nالهدف\nاتخذ قرارا وافعله\nيمكنك تغيير هدف اللياقة البدنية الخاصة بك متوافقا مع مقدار زيادة أو تقليل الوزن، والذهاب نحو طريق النجاح.\nعرض مؤشرات وتقارير الهدف\nفي طريق النجاح بالضبط!\nيمكنك أخذ التقرير من كل شيء بالنسبة إلى فترة زمنية في أكسيجن فيت، من السعرات الحرارية التي تم استهلاكها حتى كمية امتصاص مادة مغذية لكل يوم أو تغيير حجم جوارحك و...\nمعالج الطعام الشخصي\nقم بإنشاء طعامك ومشاهدة كمية السعرات الحرارية والمواد المغذيات الخاصة به\nهناك إمكانية جذابة وفريدة من نوعها في أكسيجن فيت وهي معالج الطعام الشخصي. يمكنك تحديد طعامك، وإضافة المواد الأولية إلى طعامك، وحتى إلصاق صورة وكيفية طبخ طعامك له. ثم تحديد مقدار استهلاكك، وبعد ذلك يمكنك مشاهدة كمية السعرات الحرارية والماء والمواد المغذية التي حصلت عليها من خلال تناول هذا الطعام.\nإضافة أطعمة المطاعم\nكمية السعرات الحرارية لطعام المطعم والوجبات السريعة\nيمكنك مشاهدة ما هي كمية السعرات الحرارية والمواد المغذية والماء التي حصلت عليها بعد تناول الطعام في أي مطعم أو مطعم للوجبات السريعة.\nدون عرض الإعلانات\nيمكنك عدم رؤية الإعلانات أبدا في التطبيق من خلال شراء الاشتراك طويل الأجل.",
